import React from "react";
import { useTypewriter, Cursor } from "react-simple-typewriter";

const TypingEffectComponent = () => {
	const [text] = useTypewriter({
		words: ["Hello, I'm Naail!", "Welcome to my website!", "Enjoy your stay!"],
		loop: 0, // Set to 0 for infinite loop
		typeSpeed: 70,
		deleteSpeed: 50,
		delaySpeed: 1000,
	});

	return (
		<div>
			<h1>Typing Effect in React</h1>
			<span>{text}</span>
			<Cursor />
		</div>
	);
};

export default TypingEffectComponent;
